import React, { Component } from "react";
// import UserDetail from "./UserDetail";

class User extends Component {
  render() {
    return (
      <div>
        <p>This is the User Component</p>
        <h1>User</h1>
        <p>{this.props.myUser.fName} "" {this.props.myUser.lname}</p>

        {/* <UserDetail userData={this.props.myUserData()} /> */}
      </div>
    );
  }
}

export default User;
